import React, { Component } from "react";
//import FileUpload from "../layout/FileUpload";
//import CRM from "./CreateMatch";

export default class Match extends Component {
  constructor() {
    dateGame = new Date.now();
  }
  render() {
    console.log(dateGame);
    return (
      <div>
        <form>
          <h1> Create Match </h1>
          <h2>
            <table>
              <thead>
                <tr scope="row"> </tr>
                {/* <tr scope="row"> */}
                  My Team{" "}
                  <input type="text" size="12" value={this.props.name_team1} />
                  VS{" "}
                  <input
                    type="text"
                    id="op_name"
                    size="12"
                    // onchange={CRM.onChangeNameTeam2}
                  />
                {/* </tr> */}
                <tr scope="row">
                  First Half{" "}
                  <input
                    type="number"
                    size="10"
                    id="gt1h1"
                    // onchange={CRM.onChangeGoalTeam1Half1}
                  />{" "}
                  -{" "}
                  <input
                    type="number"
                    size="4"
                    id="gt2h1"
                    // onchange={CRM.onChangeGoalTeam2Half1}
                  />
                </tr>
                <tr scope="row">
                  Second Half{" "}
                  <input
                    type="number"
                    size="4"
                    id="gt1h2"
                    // onchange={CRM.onChangeGoalTeam1Half2}
                  />{" "}
                  -{" "}
                  <input
                    type="number"
                    id="gt2h2"
                    size="4"
                    // onchange={CRM.onChangeGoalTeam2Half2}
                  />
                </tr>
                <tr scope="row">
                  Final Score{" "}
                  <input
                    type="number"
                    id="st1h1"
                    size="4"
                    // disabled={true}
                  />{" "}
                  -{" "}
                  <input
                    type="number"
                    id="st1h2"
                    size="4"
                    // onChange={CRM.onChangeFinalScoreTeam2}
                    // disabled={true}
                  />{" "}
                </tr>
              </thead>
            </table>
          </h2>

          <p>
            {" "}
            Date
            <input
              size="8"
              type="text"
              value={dateGame}
              disabled={true}
            />
            Fixure:{" "}
            <input
              size="3"
              type="text"
              value={this.props.cycle}
              Disabled={true}
            />
          </p>
          <p>
            Home{" "}
            <input
              type="radio"
              id="home"
              name="home_or_away"
              value="home"
              checked={true}
            ></input>
          </p>
          <p>
            Away{" "}
            <input
              type="radio"
              id="away"
              name="home_or_away"
              value="away"
            ></input>
          </p>

          <table class="table table-bordered">
            <thead>
              <tr>
                <th scope="col">#</th>
                <th scopre="col">Half 1</th>
                <th id="score" scope="col">
                  Match Facts
                </th>
                <th scope="col">Half 2</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <th scope="row">1</th>

                <td>
                  {" "}
                  <input
                    type="number"
                    id="sott1h1"
                    // onChange={CRM.onChangeShotsTeam1Half}
                  />
                </td>
                <td>Shot on Target</td>
                <td>
                  <input
                    type="number"
                    id="sott1h2"
                    // onchange={CRM.onChangeShotsTeam1Half2}
                  />
                </td>
              </tr>

              <tr>
                <th scope="row">2</th>
                <td>
                  <input
                    type="number"
                    // onchange={CRM.onChangeShotsOnTargetHalf1}
                  ></input>
                </td>
                <td>Shot OFF Target</td>
                <td>
                  <input
                    type="number"
                    // onchange={CRM.onChangeShotsOnTargetHalf2}
                  ></input>
                </td>
              </tr>
              <tr>
                <th scope="row">3</th>
                <td>
                  <input
                    type="number"
                    id="co1"
                    // onChange={CRM.onChangeCornersHalf1}
                  />
                </td>
                <td>Corrner </td>
                <td>
                  {" "}
                  <input
                    type="number"
                    id="co2"
                    // onChange={CRM.onChangeCornersHalf2}
                  />
                </td>
